
CREATE DATABASE KutuphaneDb

GO

USE KutuphaneDb

GO

-- 1: TUR
-- ***************************************
CREATE TABLE [dbo].[tur] (
    [turno]  INT        IDENTITY (1, 1) NOT NULL,
    [turadi] NCHAR (30) NULL,
    CONSTRAINT [PK_tur] PRIMARY KEY CLUSTERED ([turno] ASC)
);

SET IDENTITY_INSERT [dbo].[tur] ON
SET IDENTITY_INSERT [dbo].[tur] OFF

GO


-- 2: YAZAR
-- ***************************************

CREATE TABLE [dbo].[yazar] (
    [yazarno]    INT        IDENTITY (1, 1) NOT NULL,
    [yazarad]    NCHAR (20) NULL,
    [yazarsoyad] NCHAR (20) NULL,
    CONSTRAINT [PK_yazar] PRIMARY KEY CLUSTERED ([yazarno] ASC)
);

GO

SET IDENTITY_INSERT [dbo].[yazar] ON
SET IDENTITY_INSERT [dbo].[yazar] OFF

GO

-- 3: OGRENCI
-- ***************************************

CREATE TABLE [dbo].[ogrenci] (
    [ogrno]    INT        IDENTITY (1, 1) NOT NULL,
    [ograd]    NCHAR (10) NULL,
    [ogrsoyad] NCHAR (20) NULL,
    [cinsiyet] NCHAR (1)  NULL,
    [dtarih]   DATETIME   NULL,
    [sinif]    NCHAR (4)  NULL,
    [puan]     BIGINT     NULL,
    CONSTRAINT [PK_ogrenci] PRIMARY KEY CLUSTERED ([ogrno] ASC)
);

GO

SET IDENTITY_INSERT [dbo].[ogrenci] ON
SET IDENTITY_INSERT [dbo].[ogrenci] OFF

GO

-- 4: KITAP
-- ***************************************

CREATE TABLE [dbo].[kitap] (
    [kitapno]     INT           IDENTITY (1, 1) NOT NULL,
    [isbnno]      CHAR (20)     NULL,
    [kitapadi]    VARCHAR (100) NULL,
    [yazarno]     INT           NULL,
    [turno]       INT           NULL,
    [sayfasayisi] INT           NULL,
    [puan]        INT           NULL,
    CONSTRAINT [PK_kitap] PRIMARY KEY CLUSTERED ([kitapno] ASC),
    CONSTRAINT [FK_kitap_tur] FOREIGN KEY ([turno]) REFERENCES [dbo].[tur] ([turno]) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT [FK_kitap_yazar] FOREIGN KEY ([yazarno]) REFERENCES [dbo].[yazar] ([yazarno]) ON DELETE CASCADE ON UPDATE CASCADE
);

GO

SET IDENTITY_INSERT [dbo].[kitap] ON
SET IDENTITY_INSERT [dbo].[kitap] OFF

GO

-- 5: ISLEM
-- ***************************************

CREATE TABLE [dbo].[islem] (
    [islemno] INT      IDENTITY (1, 1) NOT NULL,
    [ogrno]   INT      NULL,
    [kitapno] INT      NULL,
    [atarih]  DATETIME NULL,
    [vtarih]  DATETIME NULL,
    CONSTRAINT [FK_islem_ogrenci1] FOREIGN KEY ([ogrno]) REFERENCES [dbo].[ogrenci] ([ogrno]) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT [FK_islem_kitap1] FOREIGN KEY ([kitapno]) REFERENCES [dbo].[kitap] ([kitapno]) ON DELETE CASCADE ON UPDATE CASCADE
);

GO

SET IDENTITY_INSERT [dbo].[islem] ON
SET IDENTITY_INSERT [dbo].[islem] OFF


GO
